import "./lessonCart.scss";
import { StarSolid } from "../icons/index";
import pic from "../../assets/img/lessonPic.jpg";

const LessonCart = () => {
  return (
    <div className="lesson-cart">
      <img alt="asd" src={pic} />
      <div className="cart-content">
        <h3>Web Development</h3>
        <strong>Bastan sona React Gelistirme Egitimi</strong>
        <ul>
          <li>
            <StarSolid />
          </li><li>
            <StarSolid />
          </li><li>
            <StarSolid />
          </li><li>
            <StarSolid />
          </li><li>
            <StarSolid />
          </li>
        </ul>
      </div>
      <div className="cart-footer"></div>
    </div>
  );
};

export default LessonCart;
